import React from "react";

export default class Burgers extends React.Component{
    constructor(props){
        super(props)
        this.state={
            burgers:[]
        }
    }
    fetchBurgers(){
        fetch('https://reast-api-b141b.firebaseio.com/burgers.json')
        .then(resp=>resp.json())
        .then(resp=>this.setState({
            burgers: Object.keys(resp).map(i=>({ ...resp[i], id: i }))
        }))
        }
    componentDidMount(){
        this.fetchBurgers()
    }
    render(){
        return(
            <h1>Burgers</h1>
        )
    }
}
